var parserDrought = new ol.format.GeoJSON({
	defaultDataProjection: 'EPSG:4326',
	featureProjection: 'EPSG:3857'
});

function styleDrought(feature, resolution){
	var index;
	if(feature.get('DM') == "0"){
		color = "#FFFF00";
		index = 100;
	}
	else if(feature.get('DM') == "1"){
		color = "#FCD37F";
		index = 200;
	}
	else if(feature.get('DM') == "2"){
		color = "#FFAA00";
		index = 300;
	}
	else if(feature.get('DM') == "3"){
		color = "#E60000";
		index = 400;
	}
	else if(feature.get('DM') == "4"){
		color = "#730000";
		index = 500;
	}

	return new ol.style.Style({
        fill: new ol.style.Fill({
            color: color
		}),
		zIndex: index
    });
}

