function resetCanvas(){
	try{$('#chartContainer').remove();}catch(e){}
	$('#chartContainerParent').append('<canvas id="chartContainer"><canvas>');
	canvas = document.querySelector('#chartContainer');
	ctx = canvas.getContext('2d');
	ctx.canvas.width = '425'; // resize to parent width
	ctx.canvas.height = '300'; // resize to parent height
	return ctx;
};

function getWMS(title, name, layerName, visi) {
    var source;
    if (layerName == "Crop") {
        source = new ol.source.TileWMS({
            url: '../geoserver/wms',
            params: {
                'LAYERS': 'Farmer:' + layerName
            },
            serverType: 'geoserver',
            projection: proj102004
        });
    } else {
        source = new ol.source.TileWMS({
            url: '../geoserver/wms',
            params: {
                'LAYERS': 'Farmer:' + layerName
            },
            serverType: 'geoserver'
        });
    }
    source.on(['tileloadend', 'tileloaderror'], function() {
        ++tilesLoaded;
        var percentage = Math.round(tilesLoaded / tilesPending * 100);
        $('#js-progress-bar').css({
            'width': percentage + '%'
        });

        if (percentage >= 100) {
            setTimeout(function() {
                $('#js-progress-bar').css({
                    'width': '0',
                    'opacity': '0'
                });
                tilesLoaded = 0;
                tilesPending = 0;
            }, 600);
        }
    });

    source.on('tileloadstart', function() {
        $('#js-progress-bar').css({
            'opacity': '1',
            'height': '5px'
        });
        ++tilesPending;
    });

    var wms = new ol.layer.Tile({
        displayInLayerSwitcher: false,
        extent: wmsFetchExtent,
        title: title,
        name: name,
        source: source,
        visible: visi
    });

    return wms;
}

function getVoronoiStyle (feature){
    if (feature.S.features[0].get('type') == "PSYCH")
        val = "images/Icons/health/psych.png";
    else if (feature.S.features[0].get('type') == "CHILDRENS")
        val = "images/Icons/health/childrens.png";
    else if (feature.S.features[0].get('type') == "LTACH")
        val = "images/Icons/health/ltach.png";
    else if (feature.S.features[0].get('type') == "RELIGIOUS/NONMED")
        val = "images/Icons/health/religious.png";
    else if (feature.S.features[0].get('type') == "REHAB")
        val = "images/Icons/health/rehab.png";

    var scale = 0.6;

    style = new ol.style.Style({
        image: new ol.style.Icon({
            src: val,
            scale: scale
        })
    });
	return style
}

