function getBoundaryStyle(feature, resolution) {
	var colorid = parseFloat(feature.get('colorid'));
	var fillColor = '';
	var polyStyleConfig = '';
	var textStyleConfig = '';
	switch ($("#cohortOptsEC").val()){
		case "flat":
			if (feature.c.indexOf("us") !== -1 || feature.c.indexOf("region") !== -1 || feature.c.indexOf("ari") !== -1 || feature.c.indexOf("bea") !== -1 || feature.c.indexOf("censusf") !== -1 || feature.c.indexOf("censusn") !== -1 || feature.c.indexOf("rea") !== -1) {
				color = "#FAAF18";
				dashStyle = [0, 0];
			}
			if (feature.c.indexOf("state") !== -1) {
				color = "#000000";
				dashStyle = [0, 0];
			}
			if (feature.c.indexOf("district") !== -1) {
				color = "#00A54F";
				dashStyle = [5, 10];
			}
			if (feature.c.indexOf("cities") !== -1) {
				color = "#F36E21";
				dashStyle = [5, 10];
			}
			if (feature.c.indexOf("counties") !== -1) {
				color = "#A46D05";
				dashStyle = [7, 4];
			}
			if (feature.c.indexOf("zip") !== -1) {
				color = "#00AEEF";
				dashStyle = [0, 0];
			}
			if (feature.c.indexOf("msa") !== -1) {
				color = "#722A78";
				dashStyle = [7, 4];
			}
			if (feature.c.indexOf("neighb") !== -1) {
				color = "#ED028C";
				dashStyle = [7, 4];
			}
			if (feature.c.indexOf("hrr") !== -1) {
				color = "#3CABDB";
				dashStyle = [0, 0];
			}
			if (feature.c.indexOf("hsa") !== -1) {
				color = "#595BD4";
				dashStyle = [0, 0];
			}
			if (feature.c.indexOf("pcsa") !== -1) {
				color = "#FD3259";
				dashStyle = [0, 0];
			}else				
				dashStyle = [0, 0];

			polyStyleConfig = {
				stroke: new ol.style.Stroke({
					color: color,
					width: 2,
					lineDash: dashStyle
				})
			};
			
			textStyleConfig = {
				text: new ol.style.Text({
					text: feature.get('name'),
					font: 'Bold 18px Lato Bold',
					fill: new ol.style.Fill({
						color: color
					}),
					stroke: new ol.style.Stroke({
						color: "#FFFFFF",
						width: 2
					})
				}),
				geometry: function(feature) {
					var retPoint;
					if (feature.getGeometry().getType() === 'MultiPolygon') {
						retPoint = getMaxPoly(feature.getGeometry().getPolygons()).getInteriorPoint();
					} else if (feature.getGeometry().getType() === 'Polygon') {
						retPoint = feature.getGeometry().getInteriorPoint();
					}
					return retPoint;
				}
			}
			
		break;
		case "topo":
			fillColor = '#715b5b';
			if (colorid == 0)
				fillColor = 'rgba(185, 103, 95, 1)';
			else if (colorid == 1)
				fillColor = 'rgba(209, 144, 46, 1)';
			else if (colorid == 2)
				fillColor = 'rgba(172, 156, 109, 1)';
			else if (colorid == 3)
				fillColor = 'rgba(87, 119, 0, 1)';
			else if (colorid == 4)
				fillColor = 'rgba(103, 125, 144, 1)';
			else if (colorid == 5)
				fillColor = 'rgba(223, 168, 140, 1)';

			polyStyleConfig = {
				fill: new ol.style.Stroke({
					color: fillColor
				})
			};
			
			textStyleConfig = {
				text: new ol.style.Text({
					text: feature.get('name'),
					font: 'Bold 18px Lato Bold',
					fill: new ol.style.Fill({
						color: "#000000"
					})
				}),
				geometry: function(feature) {
					var retPoint;
					if (feature.getGeometry().getType() === 'MultiPolygon') {
						retPoint = getMaxPoly(feature.getGeometry().getPolygons()).getInteriorPoint();
					} else if (feature.getGeometry().getType() === 'Polygon') {
						retPoint = feature.getGeometry().getInteriorPoint();
					}
					return retPoint;
				}
			}
		break;
	}
    var textStyle = new ol.style.Style(textStyleConfig);
    var style = new ol.style.Style(polyStyleConfig);
	
	if(!hideLabelsRegions)
		return [style, textStyle];
	else
		return [style];
}

function fetchAndDispRadius(circle, lowpoly, cond, lyr){
	var wktFormat = new ol.format.WKT();
	if(cond == "within"){
		$.ajax({
			type: "GET",
			url: "intersectedBoundaries.php?id=" + $("#selWithinRadius").val(),
			data: 'passedPolygon=' + wktFormat.writeGeometry(lowpoly),
			cache: false,
			success: function(data)
			{
				content.innerHTML = getPopupContent("<h3> " + data + " " + $("#selWithinRadius option:selected").html() + " Found</h3>", "<div style='float:left;'></div>", "", "points", ol.proj.transform(circle.getCenter(), 'EPSG:3857', 'EPSG:4326'));
				overlay.setPosition(circle.getCenter());
			}
		});
	}
	else if(cond=="sql"){
        var tilesLoaded = 0;
        var tilesPending = 0;
		var features = lyr.getSource().getFeatures();
		var convertedFeatures = [];
		var i;
		for (i = 0; i < features.length; i++) {
		  convertedFeatures.push(wktFormat.writeGeometry(ol.geom.Polygon.fromCircle(features[i].getGeometry())));
		}

		try {
			// Opera 8.0+, Firefox, Safari
			ajaxPOSTTestRequest = new XMLHttpRequest();
                    $('#js-progress-bar').css({
                        'opacity': '1',
                        'height': '5px',
                        'width': '5%'
                    });
                    ++tilesPending;
		} catch (e) {
			// Internet Explorer Browsers
			try {
				ajaxPOSTTestRequest = new ActiveXObject("Msxml2.XMLHTTP");
			} catch (e) {
				try {
					ajaxPOSTTestRequest = new ActiveXObject("Microsoft.XMLHTTP");
				} catch (e) {
					// Something went wrong
					alert("Your browser broke!");
					return false;
				}
			}
		}

		ajaxPOSTTestRequest.onreadystatechange = ajaxCalled_POSTTest;
		var url = "gsj.php";
		var params = "id="+ $("#selSQLJoin").val() +"&f="+ JSON.stringify(convertedFeatures);
		ajaxPOSTTestRequest.open("POST", url, true);
		ajaxPOSTTestRequest.setRequestHeader("Content-type", "application/x-www-form-urlencoded");
		ajaxPOSTTestRequest.send(params);
	}

    function ajaxCalled_POSTTest() {
        if (ajaxPOSTTestRequest.readyState == 4) {
			try {sqlJoinSource.clear();} catch (ex) {}
			sqlJoinSource = new ol.source.Vector({
				format: isoFormat,
				loader: function(extent, resolution, projection) {
                    ++tilesLoaded;
                    var percentage = Math.round(tilesLoaded / tilesPending * 100);
                    $('#js-progress-bar').css({
                        'width': percentage + '%'
                    });
                    if (percentage >= 100) {
						var features = isoFormat.readFeatures(ajaxPOSTTestRequest.responseText);
						sqlJoinSource.addFeatures(features);
                        setTimeout(function() {
                            $('#js-progress-bar').css({
                                'width': '0',
                                'opacity': '0'
                            });
                            tilesLoaded = 0;
                            tilesPending = 0;
                        }, 600);
                    }
				},
				strategy: ol.loadingstrategy.all
			});

			sqlJoinLayer.setSource(sqlJoinSource);
			sqlJoinLayer.setVisible(true);
        }
    }
}